VALUES ('3560070545117', '12 Petites Corolles', '_Corolles aux légumes (28%)-fromage au bleu (50g) :_ Aubergine préfrite 19% (aubergine 14%, huile de tournesol), eau, gorgonzola 17%, courgette grillée 11%, farine de blé, tomate semi-déshydratée 3,7%, oignon préfrit (oignon, huile de tournesol), confit d\'oignon (oignon blanc, sucre, vinaigre de Xérès, caramel, concentré de tomate, amidon modifié de maïs, sel, poivre noir), fromage frais, huile d\'olive vierge extra, échalote, citron confit (citron, sucre, acidifiant : acide citrique, antioxydant : acide ascorbique), persil, ail, amidon modifié de maïs, stabilisants : méthycellulose et farine de graines de caroube, fibre de blé, sel, piment de Cayenne, dextrose, blanc d\'œuf en poudre, huile de tournesol, œuf entier en poudre, farine de fèves, gluten de blé, farine de blé malté, levure désactivée.  Corolle au fromage frais-pignons-basilic (50g) : Fromage frais 22%, eau, courgette grillée, farine de blé, pignons de pin 7,6%, fromage râpé, parmesan, huile d\'olive vierge extra, œuf entier, basilic 2,6%, ail, sel, épaississants : gomme xanthane et gomme guar, poivre, dextrose, blanc d\'œuf en poudre, huile de tournesol, œuf entier en poudre, farine de fèves, gluten de blé, farine de blé malté, levure désactivée.  Corolle aux légumes (27%)-fromage de chèvre (50g) : Eau, fromage au lait de chèvre 18%, courgette grillée 15%, farine de blé, aubergine préfrite 6,3% (aubergine 4,7%, huile de tournesol), crème (crème, stabilisant : carraghénanes), tomate 4,7%, mozzarella, fromage râpé, huile d\'olive vierge extra, poivron rouge 3,1%, ail, amidon modifié de maïs, stabilisants : méthycellulose et farine de graines de caroube, fibre de blé, purée de tomate double concentrée, thym, sel, piment de Cayenne, dextrose, blanc do\'euf en poudre, huile de tournesol, œuf entier en poudre, farine de fèves, gluten de blé, farine de blé malté, levure désactivée. Pourcentages exprimés sur chaque corolle garnie. Peut contenir des traces de crustacés, poissons, soja, fruits à coque et mollusques.', 'https://static.openfoodfacts.org/images/products/356/007/054/5117/front_fr.12.400.jpg', '18', '6.8', '14', '2.8', '2.4', '9.5', '1.1', '0.433070866141732', '', '0');

