 (lacuséum, amidon de pomme de terre, lait entier, sel, épaississant : gomme xanthane, poivre, muscade), huile d\'olive vierge extra, ail, amidon modifié de pomme de terre, sei, menthe poivrée. Mini paniers crevette chorizo 25% : Pâte feuilletée 58% : Farine de blé, margarine (matières grasses de palme et de colza, eau, sel, émulsifiant : mono - et diglycérides dacides gras, correcteur d\'acidité : acide citrique), eau, sel, œuf en poudre. Garniture 42% : Crème (crème, stabilisant : carraghénanes), crevette cuite décortiquée 8,3% sel), chorizo précuit 7,3% (viande de porc, épices et plantes aromatiques, sel, lactose, dextrose, arômes naturels, conservateurs : acide ascorbique - ascorbate de sodium - nitrite de sodium), oignon rissolé (oignon, huile de toumesol), poivron rouge, poivron vert, préparation déshydratée pour sauce blanche (lactosérum, amidon modifié de pomme de terre, laii entier, sel, épaississant : gomme xanthane, poivre, muscade), eau, amidon modifié de pomme de terre, extrait de curwma. Pourcentages exprimés sur chaque de mini-panier. Ce produit est fabriqué à partir de poulet origine France. Peut contenir des traces de céleri, graines de sésame, mollusques, moutarde, poisson, soja et autres fruits à coque. _ _ arnalen en chorizo • Die', '', '17', '8.8', '24', '2.7', '3.1', '5.5', '1.2', '0.47244094488189', '', '0');

