INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3560070649297', 'Dégustation aux 3 chocolats  Assortiment de biscuits fins', 'Farine de blé, chocolat noir 18,9% (pâte de cacao, sucre, beurre de cacao, matière grasse laitière anhydre, émulsifiant : lécithines de tournesol), chocolat au lait 18,9% (sucre, beurre de cacao, pâte de cacao, lait écrémé en poudre, lactose, matière grasse laitière anhydre, lactosérum en poudre, émulsifiant : lécithines de tournesol), chocolat blanc 9% (sucre, beurre de cacao, lait entier en poudre, émulsifiant : lécithines de tournesol) , sucre, beurre concentré, noisettes hachées grillées 3,5%, noix de coco râpée 3,5%, chocolat blanc au café 2,4% (sucre, beurre de cacao, lait entier en poudre, café 0,04 %, café instantané 0,005 %, paprika), huile de tournesol, graines de sésame toastées 1.4%, farine semi-complète de seigle, œufs, amidon de blé, sirop de sucre candi inverti, pépites de framboises séchées sucrées 0,4% (sirop de glucose, framboises déshydratées 0,18 %), poudres à lever : carbonates d\'ammonium - carbonates de sodium - diphosphates, extrait de malt d\'orge, farine d\'orge, sel, arômes naturels,laitécrémé en poudre, colorant : caramel ordinaire, caramel aromatique, cannelle en poudre, gluten de blé, poudre d\'amandes. Peut contenir des traces d\'autres fruits à coque.', 'https://static.openfoodfacts.org/images/products/356/007/064/9297/front_fr.33.400.jpg', '30', '16', '58', '35', '4.1', '6.7', '0.42', '0.165354330708661', '', '0');

