VALUES ('3560070695720', 'Canapés traiteur, 5 recettes', 'Variez les plaisirs avec notre sélection de canapés Carrefour déclinés en 5 recettes originales : aussi beaux que bons, nos canapés vous séduiront par Leur moelleux et leurs saveurs raffinées aux associations étonnantes. Un grand moment de découverte à partager. 20 canapés traiteur : 4 mini blinis au fromage de chèvre, préparation à base de tomates et roquette, 4 mini blinis saumon cuit et aneth, 4 canapés au poivron rouge, 4 canapés à la viande d\'agneau traitée en salaison au curry, 4 canapés rillettes de canard et zestes d\'orange. Ingrédients Mini b!inis au fromage de chèvre, préparation à base de tomates et roquette 24,7% : mini blinis 10,8% demi écrémé stérilisé, farine de blé, eau, huile de colza, neuf entier en poudre, sucre, sel, levure de boulangerie, huile de tournesol, gluten de uéJ, fromage de chèvre 7,3%, préparation à base de tomates 3,9% (tomate mi séchée 3,6%, huile de colza, sel, origan, ail), spécialité laitière (eau, protéine de lait, heure, sel), Jaji demi écrémé, roquette 0,5%, amidon modifié de maïs. Mini blinis au saumon cuit et aneth 21% : mini blinis 10,8% [hit demi écrémé stérilisé, farine de blé, eau, huile de colza, oeuf entier en poudre, sucre, sel, levure de boulangerie, huile de tournesol, gluten de blé], saumu cuit 5,2%, fromage frais 2,5%, demi écrémé, zeste de citron jaune, jus de citron, graines de pavot, amidon transformé de pomme de terre, aneth 0,06%, sel, poivre. Garniture au poivron rouge sur pain de mie spécial à la farine complète de blé 18,8% : pain de mie spécial 6,8% [préparation à base de farine complète (farine complète de blé 2,3%, gluten de b]é, sel, agent de traitement de la farine : acide ascorbique), eau, farine de blé, améliorant de panification (farine de blé malté toasté, sucre caramélisé en poudre (sirop de glucose et sucre caramélisé), poudre de cacao dégraissé, farine de blé), levure de boulangerie, œuf entier en poudre, sel, gl_uien de hé], préparation à base de poivron rouge 3,5% (poivrons mi-séchés 1 huile de colza, concentré de tomates, sel, jus de citron concentré, ail, sucre), fromage frais, beurre, tomates pelées concassées (tomates jus de tomate, acidifiant : acide citrique), amidon transformé de pomme de terre, huile de toumesol, épices et aromates 0,3% (poivron, poivre, coriandre, graines de moutarde, carvi, oignon, huile de colza), purée de tomate, protéines de laji, eau, sel. Gamiture à la viande d\'agneau traitée en salaison au curry sur pain de mie spécial à la farine complète de blé 18,3% : pain de mie spécial 6,8% [préparation à base de farine complète (farine complète de blé 2,3%, g!uien de blé, sel, agent de traitement de la farine : acide ascorbique), eau, farine de blé, améliorant de panification (farine de h.lé malté toasté, sucre caramélisé en poudre (sirop de glucose et sucre caramélisé), poudre de cacao dégraissé, farine de blé), beurre, levure de boulangerie, œuf entier en poudre, sel, gluten de blé], fromage frais, lait demi écrémé, viande d\'agneau cuite traitée en salaison 1,9% [épaule d\'agneau 1,7%, sel, fécule de pomme de terre, Lactose, acidifiant : citrate de sodium), préparation à base de tomates [tomates (tomates mi-séchées, concentré de tomates), huile de colza, sel, origan, sucre, ail], raisin sec (raisin, huile de coton non hydrogénée), marinade au curry 0,6% [huiles de colza-tournesol, épices et aromates (curcuma, coriandre, oignon, ail, cardamome, gingembre, cannelle), sel, arômes naturels, émulsifiant : mono et diglycérides d\'acides gras], persil, amidon transformé de pomme de terre, huile de tournesol, ail, cumin. Garniture aux rillettes de canard et zestes d\'orange sur pain de mie nature 17,2% : rillettes de canard 7,5% [viande de canard 3,3%, graisse de canard 2,2%, viande et gras de porc 1%, eau, sel, poivre], pain de mie nature 6,8% (farine de blé, eau, sirop de sucre inverti, he_uŒe, Q.euf entier en poudre, levure de boulangerie, écrémé en poudre, sel, sucre, farine de b_té malté, gluten de blé), eau, semoule de pois déshydratés, zeste d\'orange 0,5%. Ce produit contient de la viande d\'agneau origine non UE, de la viande de canard et de la viande porc origine France. Peut contenir des traces de : céleri, fruits à coque, lupin, soja, sésame, mollusques, crustacés.', '', '15', '5.6', '21', '5.6', '3.1', '7.6', '1.2', '0.47244094488189', '', '0');

