VALUES ('3560070718511', 'Carrefour coffret crackers', 'Crackers à l\'emmental : Farine de blé, huiles végétales (colza, tournesol), emmental râpé 17%, sucre, poudres à lever : phosphates de calcium - carbonates de sodium - carbonates d\'ammonium, sirop de sucre inverti, sel, farine d\'orge maltée. Crackers goût pizza : Farine de blé, huiles végétales (colza, tournesol), emmental râpé, double concentré de tomate 6,4%, sucre, lactosérum en poudre, poudres à lever : phosphates de calcium - carbonates de sodium - carbonates d\'ammonium, sel, farine maltée, herbes de Provence 1%, arôme naturel, sirop de sucre inverti, oignon en poudre. Crackers aux graines de sésame et de pavot : Farine de blé, huiles végétales (colza, tournesol), sucre, graines de sésame 4,8%, graines de pavot 2,4%, poudres à lever : phosphates de calcium - carbonates de sodium - carbonates d\'ammonium, farine d\'Q?ge maltée, sel, sirop de sucre inverti caramélisé, épices, extrait de levure, thym, arôme naturel (contient blé), oignon en poudre, extrait de poivre noir. Crackers aromatisés bacon : Farine de huiles végétales (colza, tournesol), sucre, arôme et arômes de fumée, sel, poudres à lever : phosphates de calcium - carbonates de sodium - carbonates d\'ammonium, farine d\'orge maltée, sirop de sucre inverti.', 'https://static.openfoodfacts.org/images/products/356/007/071/8511/front_fr.20.400.jpg', '27', '3.7', '58', '6.3', '3.2', '10', '1.6', '0.62992125984252', '', '0');

