VALUES ('3560070726226', '30 Mini feuilletés apéritifs', '8 Feuilletés épinard et ricotta 27% : Farine de blé (farine de blé, gluten de blé), margarine (huiles et graisses végétales de palme et de colza, eau, sel, émulsifiant : mono - et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), eau, épinard 16,7%, ricotta 15,5%, préparation pour sauce béchamel en poudre (lactosérum, amidon modifié de pomme de terre, lactose, lait en poudre écrémé, crème en poudre, farine de blé, sel, muscade, poivre), œufs en poudre, arôme naturel (contient lait), sel, lactose et protéines de lait, crème en poudre, poivre. Feuilleté préparé avec 58% de pâte. Pourcentages exprimés sur le feuilleté épinard et ricotta. 8 Feuilletés légumes et tomate 25% : Farine de blé (farine de blé, gluten de blé), eau, margarine (huiles et graisses végétales de palme et de colza, eau, sel, émulsifiant : mono - et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), courgettes 8,5%, purée de tomate mi-réduite 5,3%, poivrons 3,5%, double concentré de tomate 3,2%, oignons rissolés 2,8% (oignons 2,5%, huile de tournesol), huile d\'olive vierge extra, préparation pour sauce béchamel en poudre (lactosérum, amidon modifié de pomme de terre, lactose, lait en poudre écrémé, crème en poudre, farine de blé, sel, muscade, poivre), tomates mi-séchées assaisonnées 1,7% (tomates 1,6%, huile de colza, sel, origan, ail), préparation à base d\'aubergines 0,7% (aubergines grillées 0,6%, huile de colza, vinaigre de Xérès, sel, origan, ail, acidifiant : acide citrique), sel, origan 0,003%, lactose et protéines de lait, sucre, crème en poudre, œufs en poudre, ail, poivre, persil, basilic. Feuilleté préparé avec 60% de pâte. Pourcentages exprimés sur le feuilleté légumes et tomate. 7 Feuilletés saucisse et moutarde 25% : Saucisse de Strasbourg 31,7% (viande de porc 26%, eau, sel, sucre, extrait d\'épices, conservateur : nitrite de sodium, antioxydant : érythorbate de sodium), farine de blé (farine de blé, gluten de blé), eau, margarine (huiles et graisses végétales de palme et de colza, eau, sel, émulsifiant : mono - et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), moutarde 2,4% (eau, graines de moutarde, vinaigre d\'alcool, sel, acidifiant : acide citrique, conservateur : disulfite de potassium), préparation pour sauce béchamel en poudre (lactosérum, amidon modifié de pomme de terre, lactose, lait en poudre écrémé, crème en poudre, farine de blé, sel, muscade, poivre), graines de pavot, sel, œufs en poudre, amidon modifié de pomme de terre, lactose et protéines de lait, emmental râpé, crème en poudre. Feuilleté préparé avec 55,5% de pâte. Pourcentages exprimés sur le feuilleté saucisse et moutarde. 7 Feuilletés saumon et aneth 23% : Eau, farine de blé (farine de blé, gluten de blé), margarine (huiles et graisses végétales de palme et de colza, eau, sel, émulsifiant : mono - et diglycérides d\'acides gras, correcteur d\'acidité : acide citrique), saumon Atlantique 12,6%, fromage blanc, pulpe de saumon fumé 3,1% (saumon Atlantique, sel), amidons modifiés de pomme de terre, oignons rissolés (oignons, huile de tournesol), jus de citron à base de concentré (contient : conservateur : disulfite de sodium), préparation pour sauce béchamel en poudre (lactosérum, amidon modifié de pomme de terre, lactose, lait en poudre écrémé, crème en poudre, farine de blé, sel, muscade, poivre), sel, aneth 0,5%, œufs en poudre, lactose et protéines de lait, crème en poudre. Feuilleté préparé avec 58% de pâte. Pourcentages exprimés sur le feuilleté saumon et aneth. Peut contenir des traces de mollusques, crustacés, céleri, graines de sésame et fruits à coque.', '', '18', '9.3', '24', '3', '1.4', '6.5', '1', '0.393700787401575', '', '1');

